import React from 'react'
import './Modal.css'

export default class Modal extends React.Component{
    render(){
        return(
            <React.Fragment>
                <div className="modal">
                    <div className="modal-body ">
                        <h1>Header</h1>
                        <p>Some info</p>
                        <button>Close</button>
                    </div>
                </div>
            </React.Fragment>
        )
    }
}
